    false,nt"url": null,nt"notes": "This dataset contains bathymetric data
    as contours for the the greater Monterey Bay area between Point Ano Nuevo to the
    north and Point Sur to the south. NOSBATC are bathymetric contours at 10-m intervals
    to a depth of 200 m and 100-m intervals to maximum depth. This is one of a collection
    of digital files of a geographic information system of spatially referenced data
    related to the U.S. Geological Survey (USGS), Coastal and Marine Geology Program
    (CMGP) "Monterey Bay National Marine Sanctuary Project" <http://walrus.wr.usgs.gov/mbms>.
    The data were collected and analyzed between 1994 and 2000.",nt"license_title":
